import React from 'react';
import {BrowserRouter as router ,Routes, Route, useNavigate } from 'react-router-dom';

import { Landing } from './components'

const App = () => {
  return (
    <>
      <Routes>
        <Route path="/Login" element={<Landing />} />
      </Routes>
    </>
  )
}

export default App
